import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const TypeEdit = () => {
  const House_API = "http://26.90.237.200:3000/admin/house_type/edit";
  const navigate = useNavigate();
  
//   {
//     "id": "10",
//     "newHousePlan": "เพชรน้ำเอกพิเศษ",
//     "newNumDeed": "040831",
//     "newLandArea": 85,
//     "newPrice": 3405500,
//     "newNote": "ต่อเติม",
//     "newStatus": 0,
//     "newImage": null,
//     "newidFK": 2
// }
  const [id, setId] = useState("");
  const [newHousePlan, setNewHousePlan] = useState("");
  const [newNumDeed, setNewNumDeed] = useState("");
  const [newLandArea, setNewLandArea] = useState("");
  const [newPrice, setNewPrice] = useState("");
  const [newNote, setNewNote] = useState("");
  const [newStatus, setNewStatus] = useState("");
  const [newImage, setNewImage] = useState("");
  const [newidFK, setNewidFK] = useState("");

  const updateEmp = async () => {
    const data = {
      id: id,
      newHousePlan: newHousePlan,
      newNumDeed: newNumDeed,
      newLandArea: newLandArea,
      newPrice: newPrice,
      newNote: newNote,
      newStatus: newStatus,
      newImage: newImage,
      newidFK: newidFK,
    };

    try {
      const response = await axios.patch(House_API, data);
      console.log(response.data);
      navigate('/Housing');
    } catch (error) {
      console.error(error);
      navigate('/Housing');
    }
  };

  return (
    <div className="container">
    <form>
      <div className="mb-3">
        <div>
          <label htmlFor="id" className="form-label">
            รหัส
          </label>
          <input
            type="text"
            className="form-control"
            id="id"
            value={id}
            onChange={(e) => setId(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="newHousePlan" className="form-label">
            แปลนบ้าน
          </label>
          <input
            type="text"
            className="form-control"
            id="newHousePlan"
            value={newHousePlan}
            onChange={(e) => setNewHousePlan(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="newNumDeed" className="form-label">
            เลขที่โฉนด
          </label>
          <input
            type="text"
            className="form-control"
            id="newNumDeed"
            value={newNumDeed}
            onChange={(e) => setNewNumDeed(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="newLandArea" className="form-label">
            ขนาดพื้นที่
          </label>
          <input
            type="number"
            className="form-control"
            id="newLandArea"
            value={newLandArea}
            onChange={(e) => setNewLandArea(parseInt(e.target.value))}
          />
        </div>
        <div>
          <label htmlFor="newPrice" className="form-label">
            ราคา
          </label>
          <input
            type="number"
            className="form-control"
            id="```jsx
            newPrice"
            value={newPrice}
            onChange={(e) => setNewPrice(parseInt(e.target.value))}
          />
        </div>
        <div>
          <label htmlFor="newNote" className="form-label">
            หมายเหตุ
          </label>
          <input
            type="text"
            className="form-control"
            id="newNote"
            value={newNote}
            onChange={(e) => setNewNote(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="newStatus" className="form-label">
            สถานะ
          </label>
          <input
            type="number"
            className="form-control"
            id="newStatus"
            value={newStatus}
            onChange={(e) => setNewStatus(parseInt(e.target.value))}
          />
        </div>
        <div>
          <label htmlFor="newImage" className="form-label">
            รูปภาพ
          </label>
          <input
            type="file"
            className="form-control"
            id="newImage"
            onChange={(e) => setNewImage(e.target.files[0])}
          />
        </div>
        <div>
          <label htmlFor="newidFK" className="form-label">
            รหัส FK
          </label>
          <input
            type="number"
            className="form-control"
            id="newidFK"
            value={newidFK}
            onChange={(e) => setNewidFK(parseInt(e.target.value))}
          />
        </div>
      </div>
      <button type="button" className="btn btn-primary" onClick={addHouse}>
        เพิ่มบ้าน
      </button>
    </form>
  </div>
  );
};

export default TypeEdit;
